import React from "react";

export default function h1() {
  return (
    <div>
      <h1>About This App</h1>
      <p className="my-1">This is a fullstack React app for keeping contacts</p>
      <p className="bg-dark p">
        <strong>Version: </strong> 1.0.0
      </p>
    </div>
  );
}
